import illustration from "../../assets/illustration.svg";
import NuKenzie from "../../assets/NuKenzie.svg";
import "./index.css";

export const Homepage = ({setShowHomepage}) => {

    const changePage = () => {
        setShowHomepage(false)
    };

  return (
    <main className="Home-header">
      <section className="App-section">
        <img className="App-logo" src={NuKenzie} alt="logo" />
        <h1>Centralize o controle das suas finanças</h1>
        <p>de forma rápida e segura</p>
        <button className="App-button" onClick={() => changePage()}>
          Iniciar
        </button>
      </section>

      <aside className="App-aside">
        <img className="App-illustration" src={illustration} alt="" />
      </aside>
    </main>
  );
};
